12.query:
fetch spans
| filter k8s.namespace.name == "astroshop" and in(k8s.namespace.name, $Environment)
// only spans which contain a span event of type "exception"
| filter iAny(span.events[][span_event.name] == "exception")
// exclude specific exception
| filter iAny(not contains(span.events[][exception.message], "404"))
// make exception attributes top level attributes
| expand span.events 
| fields span.events | fieldsFlatten span.events | fieldsRemove span.events | fieldsAdd timestamp = span.events.timestamp
| makeTimeseries count()
